import Card from 'react-bootstrap/Card'
import Button from 'react-bootstrap/Button'
import profile from '../assets/profile.jpg'
import { Image } from 'react-bootstrap'
// import classes from './Home.module.css'

const Home = () => {
  return (
    <Card style={{ margin: 'auto', width: '400px' }} bg="secondary" text="white" className="text-center">
      <Image style={{ margin: 'auto', width: '100px' }} src={profile} alt="Card Image" rounded />
      {/* <Card.Img style={{}} variant="top" src={profile} alt="Card Image" roundedCircle /> */}
      < Card.Body >
        <Card.Title>About Me</Card.Title>
        <Card.Text>Welcome to my demo page. This is just a simple CV page I did to practice basic React JS concepts.</Card.Text>
        <Card.Text>I started my journey as a web developer in 2019 and felt highly inclined towards FrontEnd
          development.</Card.Text>
        <Card.Text>I've always been passionate about the <b>UI/UX</b> we experience on a daily basis through Apps
          and webpages.</Card.Text>
        <Card.Text>I believe that high quality <b>UI/UX</b> can contribute to make our lives easier and bring joy while interacting with these tools.</Card.Text>
        <Button style={{ margin: '0px 10px' }} variant="primary">Work</Button>
        <Button style={{ margin: '0px 10px' }} variant="primary">Study</Button>
      </Card.Body>
    </Card >
  )
}

export default Home;


